import React from 'react'

import {ToastContainer, toast} from 'react-toastify';
import 'react-toastify/dist/react-toastify';

function TestToast() {
  const notify = () =>{
    toast("Toast");
  }
  return (
    <>
    <div><br/><br/><br/>TestToast
    <button onClick = {notify}></button>
    </div>
    <ToastContainer />
    </>
  )
}

export default TestToast;
